import { useState } from 'react';
import './App.css';

function App() {
  const [propertyInfo, setPropertyInfo] = useState({
    address: '',
    rentAmount: '',
    dueDate: ''
  });

  const [tenantInfo, setTenantInfo] = useState({
    name: '',
    email: '',
    phone: ''
  });

  const [rentEntries, setRentEntries] = useState([]);

  const handlePropertyChange = (e) => {
    const { name, value } = e.target;
    setPropertyInfo(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleTenantChange = (e) => {
    const { name, value } = e.target;
    setTenantInfo(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const addRentEntry = (e) => {
    e.preventDefault();

    if (!propertyInfo.address || !propertyInfo.rentAmount || !propertyInfo.dueDate || 
        !tenantInfo.name || !tenantInfo.email || !tenantInfo.phone) {
      alert('Please fill in all fields');
      return;
    }

    const newEntry = {
      id: Date.now(),
      property: { ...propertyInfo },
      tenant: { ...tenantInfo },
      status: 'Pending',
      createdAt: new Date().toLocaleDateString()
    };

    setRentEntries(prev => [...prev, newEntry]);

    // Reset forms
    setPropertyInfo({ address: '', rentAmount: '', dueDate: '' });
    setTenantInfo({ name: '', email: '', phone: '' });
  };

  const markAsPaid = (id) => {
    setRentEntries(prev => 
      prev.map(entry => 
        entry.id === id ? { ...entry, status: 'Paid' } : entry
      )
    );
  };

  const deleteEntry = (id) => {
    setRentEntries(prev => prev.filter(entry => entry.id !== id));
  };

  const calculateTotal = () => {
    return rentEntries.reduce((sum, entry) => {
      if (entry.status === 'Pending') {
        return sum + parseFloat(entry.property.rentAmount || 0);
      }
      return sum;
    }, 0).toFixed(2);
  };

  return (
    <div className="App">
      <div className="container">
        <h1 className="app-title">Rent Calculator & Manager</h1>

        <div className="forms-section">
          <form className="form-card" onSubmit={addRentEntry}>
            <h2>Property Information</h2>
            <div className="form-group">
              <label htmlFor="address">Property Address *</label>
              <input
                type="text"
                id="address"
                name="address"
                value={propertyInfo.address}
                onChange={handlePropertyChange}
                placeholder="123 Main St, City, State"
                required
              />
            </div>

            <div className="form-group">
              <label htmlFor="rentAmount">Monthly Rent Amount ($) *</label>
              <input
                type="number"
                id="rentAmount"
                name="rentAmount"
                value={propertyInfo.rentAmount}
                onChange={handlePropertyChange}
                placeholder="1500"
                step="0.01"
                min="0"
                required
              />
            </div>

            <div className="form-group">
              <label htmlFor="dueDate">Due Date *</label>
              <input
                type="date"
                id="dueDate"
                name="dueDate"
                value={propertyInfo.dueDate}
                onChange={handlePropertyChange}
                required
              />
            </div>

            <h2>Tenant Contact Information</h2>
            <div className="form-group">
              <label htmlFor="name">Full Name *</label>
              <input
                type="text"
                id="name"
                name="name"
                value={tenantInfo.name}
                onChange={handleTenantChange}
                placeholder="John Doe"
                required
              />
            </div>

            <div className="form-group">
              <label htmlFor="email">Email Address *</label>
              <input
                type="email"
                id="email"
                name="email"
                value={tenantInfo.email}
                onChange={handleTenantChange}
                placeholder="john.doe@example.com"
                required
              />
            </div>

            <div className="form-group">
              <label htmlFor="phone">Phone Number *</label>
              <input
                type="tel"
                id="phone"
                name="phone"
                value={tenantInfo.phone}
                onChange={handleTenantChange}
                placeholder="(555) 123-4567"
                required
              />
            </div>

            <button type="submit" className="btn-submit">Add Rent Entry</button>
          </form>
        </div>

        <div className="summary-section">
          <div className="summary-card">
            <h3>Total Rent to be Paid</h3>
            <div className="total-amount">${calculateTotal()}</div>
            <p className="summary-detail">
              {rentEntries.filter(e => e.status === 'Pending').length} pending payment(s)
            </p>
          </div>
        </div>

        <div className="entries-section">
          <h2>Rent Entries</h2>
          {rentEntries.length === 0 ? (
            <p className="no-entries">No rent entries yet. Add your first property and tenant above.</p>
          ) : (
            <div className="entries-list">
              {rentEntries.map(entry => (
                <div key={entry.id} className={`entry-card ${entry.status.toLowerCase()}`}>
                  <div className="entry-header">
                    <h3>{entry.property.address}</h3>
                    <span className={`status-badge ${entry.status.toLowerCase()}`}>
                      {entry.status}
                    </span>
                  </div>

                  <div className="entry-details">
                    <div className="detail-section">
                      <h4>Property Details</h4>
                      <p><strong>Rent Amount:</strong> ${parseFloat(entry.property.rentAmount).toFixed(2)}</p>
                      <p><strong>Due Date:</strong> {new Date(entry.property.dueDate).toLocaleDateString()}</p>
                    </div>

                    <div className="detail-section">
                      <h4>Tenant Details</h4>
                      <p><strong>Name:</strong> {entry.tenant.name}</p>
                      <p><strong>Email:</strong> {entry.tenant.email}</p>
                      <p><strong>Phone:</strong> {entry.tenant.phone}</p>
                    </div>
                  </div>

                  <div className="entry-footer">
                    <p className="created-date">Created: {entry.createdAt}</p>
                    <div className="entry-actions">
                      {entry.status === 'Pending' && (
                        <button 
                          onClick={() => markAsPaid(entry.id)} 
                          className="btn-paid"
                        >
                          Mark as Paid
                        </button>
                      )}
                      <button 
                        onClick={() => deleteEntry(entry.id)} 
                        className="btn-delete"
                      >
                        Delete
                      </button>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          )}
        </div>
      </div>
    </div>
  );
}

export default App;
